import { configureStore } from '@reduxjs/toolkit';
import authReducer from '../slice/authSlice';
import customerReducer from '../slice/customerSlice';

export const store = configureStore({
  reducer: {
    auth: authReducer,
    customer: customerReducer
  },
});
